  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Missisquoi NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Missisquoi NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, a summary of Refuge resources, information
  about the management direction, and strategies for implementation. Key planning
  issues include: river delta management, invasive species, water quality, upland
  habitat management, wildlife, monitoring, and public use.\",\n\t\"license_title\":
